import React from 'react';

function Hello({ color, name, isSpecial}) {

    return (

        <div style={{color: color}}>
            {isSpecial && <b>*</b>}
        hell world! {name}</div>
    )
}


Hello.defaultProps = {
    name: 'no',
    color: 'pink',
    isSpecial: false
}

export default Hello;
